pragma solidity ^0.8.7;
import "@openzeppelin/contracts/utils/Strings.sol";
// import "github.com/Arachnid/solidity-stringutils/strings.sol";

contract oeGame{
    uint256 num;
    uint256 public score;

    uint256 randNonce = 0;
    function random() private returns (uint) {
        randNonce++; 
        return uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, randNonce))) % 6;
    }


    function check(uint256 _num) public returns(string memory) {
        require(_num >=1 && _num <= 6, "Give a valid number between 1 and 6");

        uint256 randomNumber = 1;

        if(_num != randomNumber){
            score += randomNumber;
            return "RUNS";
        }else{
            return "OUT";
        }
    }
}

